                    <div>
                        <label>User Name:</label>&nbsp;{item.name}<br />
                        <label>User Last Name:</label>&nbsp;{item.lname}<br />
                        <label>Email :</label>&nbsp;{item.email}<br />
                        <hr />
                    </div>
                )
            })
        }
    }

    return (
        <div>
            {renderList(props)}
        </div>
    )
}

export default CourseList;
